function fbShare(e, s, n, t, i, o) {
    var a = screen.height / 2 - o / 2, c = screen.width / 2 - i / 2;
    window.open("http://www.facebook.com/sharer.php?s=100&p[title]=" + s + "&p[summary]=" + n + "&p[url]=" + e + "&p[images][0]=" + t, "sharer", "top=" + a + ",left=" + c + ",toolbar=0,status=0,width=" + i + ",height=" + o);
}

function twShare(e, s, n, t) {
    screen.height / 2 - t / 2, screen.width / 2 - n / 2;
    window.open("http://twitter.com/share?url=" + e + "&text=" + s, "", "left=0,top=0,width=" + n + ",height=" + t + ",personalbar=0,toolbar=0,scrollbars=0,resizable=0");
}

function piShare(e, s, n, t, i) {
    screen.height / 2 - i / 2, screen.width / 2 - t / 2;
    window.open("https://pinterest.com/pin/create/button/?url=" + e + "&media=" + n + "&description=" + s);
}

